bed light, Current flows through ring-shaped electrical contacts to an\nexternal circuit. The responsivity of a photodetector is how much current is\nproduced by light and is given in amps per Watt. Adjust the thickness of the\ngermanium layer and observe the changes in responsivity."},"id":"4809","type":"panel.models.markup.HTML"},{"attributes":{},"id":"4812","type":"Title"},{"attributes":{},"id":"4771","type":"DataRange1d"},{"attributes":{},"id":"4813","type":"BasicTickFormatter"},{"attributes":{},"id":"4788","type":"SaveTool"},{"attributes":{},"id":"4789","type":"ResetTool"},{"attributes":{"children":[{"id":"4806"},{"id":"4807"}],"margin":[0,0,0,0],"name":"Row00678"},"id":"4805","type":"Row"},{"attributes":{"line_alpha":0.1,"line_color":"darkblue","x":{"field":"x"},"y":{"field":"y"}},"id":"4801","type":"Line"},{"attributes":{"line_color":"darkblue","x":{"field":"x"},"y":{"field":"y"}},"id":"4800","type":"Line"},{"attributes":{"source":{"id":"4799"}},"id":"4803","type":"CDSView"},{"attributes":{"axis_label":"Gernaminum Thickness (micron)","axis_label_text_font_size":"12pt","formatter":{"id":"4816"},"major_label_policy":{"id":"4818"},"major_label_text_font_size":"12pt","ticker":{"id":"4778"}},"id":"4777","type":"LogAxis"},{"attributes":{},"id":"4815","type":"AllLabels"},{"attributes":{"align":"center","height":246,"margin":[5,5,5,5],"name":"PNG00669","text":"&amp;lt;img src=&amp;quot;data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA/cAAALLCAIAAAAzK+X6AAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAGutSURBVHhe7b0PbCXnYeBHx0moKDEj5+jYCnU+3/ZimV4bm4VTNmLKs+6yOjmgkIqo0yWaO1MO0FcHJZCUQq+hYCfbQwpWQRnRF+KM014hlOi2RxQ1iwZ6ycLlRcARF4hXoWXQIllxV2uttJW0lna3K60irbKrfjPzzbx533zz982/75vfDz/Y4rx538wjueRvht/MG/sQAAAAAADsgsoHAAAAALANKh8AAAAAwDaofAAAAAAA26DyAQAAAABsg8oHAAAAALANKh8AAAAAwDaofAAAAAAA26DyAQAAAABsg8oHAAAAALANKh8AAAAAwDaofAAAAAAA26DyAQAAAABsg8oHAFvo98YcZjcO5QKHw41Zd2mvLxdoljRCE7txeNjv9UKfnpZ8KgAAoAKofACwBSo/kb63wfCnh8oHALAXKh8AbMGsyq8d7acHAABshcoHAFug8hOh8gEAOgWVDwC2QOUnQuUDAHQKKh
